import React from 'react';

export class Testing extends React.Component {
    constructor(props) {
        super(props);
        this.boxClick = this.boxClick.bind(this);
    }

    boxClick() {
        this.setState({
          color: "red"
        })
      }
    
    render() {
        return (
            <div onClick={this.boxClick}>
                <p onClick={this.boxClick}>click here</p>
            </div>
        )
    }
}
